"use strict";
import logo from './IMG_0004.PNG';
import './App.css';
import Typography from '@mui/material/Typography';
import Box from '@mui/material/Box';
import useSound from "use-sound";
import mySound from './A_resonant_trimmed_2.mp3'; 
import React from 'react';

function App (){


  const [play, { stop }] = useSound(mySound);

  return (
    <div className="App"> 
      <header className="App-header">
        <button onMouseEnter={() => play()} onMouseLeave={() => stop()}>
          <img src={logo} className="App-logo" alt="logo"/>
        </button>
        <img src={logo} className="App-logo" alt="logo" onClick={play}/>
        <a className = "Centering" href="https://raymondgifford.com">
          Centering
        </a>
      </header>
    </div>
  );

}

export default App;
